import React from "react";

import "../../styles/footer.scss";

import { ReactComponent as NextIMG } from "../../assets/images/footer/LystvaLogo.svg";

export default function Footer() {
  return (
    <div className="footer">
      <div className="footer__content">
        <div className="footer__main">1</div>
        <div className="footer__information">2</div>
        <div className="footer__franchise">3</div>
        <div className="footer__contacts">4</div>
      </div>
    </div>
  );
}
